fields.formula:
concat( 
  "C", 
  if( 
    row_id() < 10, 
    concat("0000", row_id()), 
    if( 
      row_id() < 100, 
      concat("000", row_id()), 
      if( 
        row_id() < 1000, 
        concat("00", row_id()), 
        if( 
          row_id() < 10000, 
          concat("0", row_id()), 
          row_id() 
        ) 
      ) 
    ) 
  ) 
)

divide( 
  multiply( 
    field("Breakeven cost"), 
    add( 
      field("Suggested markup (%)"), 
      100 
    ) 
  ), 
  100
)

if( 
  or( 
    totext(field("Status"))="For releasing", 
    totext(field("Status"))="Sold" 
  ), 
  false, 
  true 
)

count( 
  filter( 
    lookup("Related cars", "In stock"), 
    lookup("Related cars", "In stock")=true 
  ) 
)

concat( 
  "S", 
  if( 
    row_id() < 10, 
    concat("0000", row_id()), 
    if( 
      row_id() < 100, 
      concat("000", row_id()), 
      if( 
        row_id() < 1000, 
        concat("00", row_id()), 
        if( 
          row_id() < 10000, 
          concat("0", row_id()), 
          row_id() 
        ) 
      ) 
    ) 
  ) 
)
